  return (
    <div className="grid grid-cols-1 md:grid-cols-4 ">
        <div className="px-6">
          <LeftSideBar />
        </div>
        <div className="col-span-3 border-x-2 border-t-slate-800 px-6">
          <MainPart />
        </div>
        <div className="px-6">
          <RightBar />
        </div>
    </div>
  )
}

export default Home;
